import React, { Component } from 'react'

import Cardun from './Cardun'
import Carddeux from './Carddeux'
import Cardtrois from './Cardtrois'
import Cardquatre from './Cardquatre'
import Cardcinq from './Cardcinq'
import Cardsix from './Cardsix'

import './dashboard.css';



$(document).ready(function() {

  function toggleSidebar() {
    $(".button").toggleClass("active");
    $("main").toggleClass("move-to-left");
    $(".sidebar-item").toggleClass("active");
  }

  $(".button").on("click tap", function() {
    toggleSidebar();
  });

  $(document).keyup(function(e) {
    if (e.keyCode === 27) {
      toggleSidebar();
    }
  });

});

class Main extends Component {

  render () {

    return (
      <div>


        <div class="nav-right visible-xs">
  <div class="button" id="btn">
    <div class="bar top"></div>
    <div class="bar middle"></div>
    <div class="bar bottom"></div>
  </div>
</div>

<main>


  <nav>
    <div class="nav-right hidden-xs">
      <div class="button" id="btn">
        <div class="bar top"></div>
        <div class="bar middle"></div>
        <div class="bar bottom"></div>
      </div>
    </div>

  </nav>

  <a href="https://codepen.io/tonkec/" class="ua" target="_blank">
    <i class="fa fa-user"></i>
  </a>
</main>

<div class="sidebar">
  <ul class="sidebar-list">
    <li class="sidebar-item"><a href="#" class="sidebar-anchor">Item 1</a></li>
    <li class="sidebar-item"><a href="#" class="sidebar-anchor">Item 2</a></li>
    <li class="sidebar-item"><a href="#" class="sidebar-anchor">Item 3</a></li>
    <li class="sidebar-item"><a href="#" class="sidebar-anchor">Item 4</a></li>
  </ul>
</div>

        <div className='container-flex'>
          <div className='row'> 
            <div className='col-lg-12 col-md-12'>
            <Cardun/>
            </div>
            <div className='col-lg-4 col-md-6'>
            <Cardtrois/>
            </div>
            <div className='col-lg-4 col-md-6'>
            <Carddeux/>
            </div>
            <div className='col-lg-4 col-md-4'>
            <Cardsix/>
            </div>
            <div className='col-lg-6 col-md-8'>
            <Cardquatre/>
            </div>
            <div className='col-lg-6 col-md-12'>
            <Cardcinq/>
            </div>

          </div>

        </div>

      </div>
    )
  }
}

export default Main
